    n, k = map(int, stdin.split())
    if n == k:
        return "1"

    chars = []
    for char in stdin:
        chars.append(char)

    char_to_cost = {}
    for i in range(n):
        char_to_cost[chars[i]] = i

    total_cost = 0
    max_len = 0

    for i in range(n):
        for j in range(i + 1, n):
            chars.pop(i)
            chars.pop(j - 1)
            total_cost += j - i
            chars.append(chars.pop(i))
            chars.insert(i, chars.pop(j - 1))
            cost = 0
            for char in chars:
                cost += char_to_cost[char]
            max_len = max(max_len, cost)
    if total_cost > k:
        return "-"

    return str(max_len - total_cost)

