        q = collections.deque()
        q.append((start, None))
        color = {start: 'green'}
        while q:
            city, prev = q.popleft()
            color[city] = 'green'
            if color[prev] == 'green':
                continue
            for neighbor in cities[city]:
                if neighbor == prev:
                    continue
                if color[neighbor] == 'green':
                    continue
                q.append((neighbor, city))
                color[neighbor] = 'yellow'
        for i in range(len(color)):
            if color[i] == 'green':
                return True
        return False

    ans = 0
    c = collections.defaultdict(list)
    for i, (x, y) in enumerate(edges):
        if color(x) and color(y):
