    def search(dna, n, k):
        if len(dna) == n:
            return -1

        visited = set()
        q = collections.deque()
        q.append(dna)
        visited.add(dna)

        while q:
            current = q.popleft()
            if len(current) == k:
                return -1

            if len(current) == n:
                return len(current)

            for i in range(k - 1, len(current)):
                next = current[i]
                if next in dna:
                    continue

                if next not in visited:
                    visited.add(next)
                    q.append(current[:i] + next + current[i + 1:])

        return -1

    return str(search(dna, n, k))

